msvmbeSoftwareElementState = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 1, 1, 1, 34), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("deployable", 0), ("installable", 1), ("executable", 2), ("running", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmbeSoftwareElementState.setStatus('current')
if mibBuilder.loadTexts: msvmbeSoftwareElementState.setDescription("The SoftwareElementState is defined in this model to identify various states of a SoftwareElement's life cycle. - A SoftwareElement in the deployable state describes the details necessary to successfully distribute it and the details (Checks and Actions) required to move it to the installable state (i.e, the next state). - A SoftwareElement in the installable state describes the details necessary to successfully install it and the details (Checks and Actions) required to create an element in the executable state (i.e., the next state). - A SoftwareElement in the executable state describes the details necessary to successfully start it and the details (Checks and Actions) required to move it to the running state (i.e., the next state). - A SoftwareElement in the running state describes the details necessary to manage the started element.")
msvmbeStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 1, 1, 1, 35), WtcsDisplayString().subtype(subtypeSpec=ValueSizeConstraint(0, 10))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmbeStatus.setStatus('current')
if mibBuilder.loadTexts: msvmbeStatus.setDescription('A string indicating the current status of the object. Various operational and non-operational statuses are defined. This property is deprecated in lieu of OperationalStatus, which includes the same semantics in its enumeration. This change is made for 3 reasons: 1) Status is more correctly defined as an array. This definition overcomes the limitation of describing status using a single value, when it is really a multi-valued property (for example, an element might be OK AND Stopped. 2) A MaxLen of 10 is too restrictive and leads to unclear enumerated values. 3) The change to a uint16 data type was discussed when CIM V2.0 was defined. However, existing V1.0 implementations used the string property and did not want to modify their code. Therefore, Status was grandfathered into the Schema. Use of the deprecated qualifier allows the maintenance of the existing property, but also permits an improved definition using OperationalStatus.')
