if mibBuilder.loadTexts: msvmhcsdHostResource.setDescription('This property exposes specific assignment to host or underlying resources. The embedded instances shall contain only key properties and be treated as Object Paths. If the virtual resource may be scheduled on a number of underlying resources, this property shall be left NULL. In that case, the DeviceAllocatedFromPool or ResourceAllocationFromPool associations may be used to determine the pool of host resources this virtual resource may be scheduled on. If specific assignment is utilized, all underlying resources used by this virtual resource shall be listed in this array. Typically the array will contain one item, however for aggregate allocations, such as multiple processors, multiple host resources may be specified.')
msvmhcsdInstanceID = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 3, 2, 1, 14), WtcsDisplayString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmhcsdInstanceID.setStatus('current')
if mibBuilder.loadTexts: msvmhcsdInstanceID.setDescription("Within the scope of the instantiating Namespace, InstanceID opaquely and uniquely identifies an instance of this class. To ensure uniqueness within the NameSpace, the value of InstanceID should be constructed using the following 'preferred' algorithm: <OrgID>:<LocalID> Where <OrgID> and <LocalID> are separated by a colon (:), and where <OrgID> must include a copyrighted, trademarked, or otherwise unique name that is owned by the business entity that is creating or defining the InstanceID or that is a registered ID assigned to the business entity by a recognized global authority. (This requirement is similar to the <Schema Name>_<Class Name> structure of Schema class names.) In addition, to ensure uniqueness, <OrgID> must not contain a colon (:). When using this algorithm, the first colon to appear in InstanceID must appear between <OrgID> and <LocalID>. <LocalID> is chosen by the business entity and should not be reused to identify different underlying (real-world) elements. If the above 'preferred' algorithm is not used, the defining entity must assure that the resulting InstanceID is not reused across any InstanceIDs produced by this or other providers for the NameSpace of this instance. For DMTF-defined instances, the 'preferred' algorithm must be used with the <OrgID> set to CIM.")
