if mibBuilder.loadTexts: msvmvcAvailability.setDescription("Note: The use of this property has been deprecated. Deprecated description: The primary availability and status of the Device. (Additional status information can be specified using the Additional Availability array property.) For example, the Availability property indicates that the Device is running and has full power (value=3), or is in a warning (4), test (5), degraded (10) or power save state (values 13-15 and 17). The Power Save states are defined as follows: Value 13 ('Power Save - Unknown') indicates that the Device is known to be in a power save mode, but its exact status in this mode is unknown; value 14 ('Power Save - Low Power Mode') indicates that the Device is in a power save state but still functioning, and might exhibit degraded performance; value 15 ('Power Save - Standby') indicates that the Device is not functioning but could be brought to full power 'quickly'; and value 17 ('Power Save - Warning') indicates that the Device is in a warning state, but is also in a power save mode.")
