msvmvcHealthState = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 3, 10, 1, 13), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 5, 10, 15, 20, 25, 30))).clone(namedValues=NamedValues(("unknown", 0), ("ok", 5), ("degradedWarning", 10), ("minorfailure", 15), ("majorfailure", 20), ("criticalfailure", 25), ("nonrecoverableerror", 30)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmvcHealthState.setStatus('current')
if mibBuilder.loadTexts: msvmvcHealthState.setDescription("Indicates the current health of the element. This attribute expresses the health of this element but not necessarily that of its subcomponents. The possible values are 0 to 30, where 5 means the element is entirely healthy and 30 means the element is completely non-functional. The following continuum is defined: 'Non-recoverable Error' (30) - The element has completely failed, and recovery is not possible. All functionality provided by this element has been lost. 'Critical Failure' (25) - The element is non-functional and recovery might not be possible. 'Major Failure' (20) - The element is failing. It is possible that some or all of the functionality of this component is degraded or not working. 'Minor Failure' (15) - All functionality is available but some might be degraded. 'Degraded/Warning' (10) - The element is in working order and all functionality is provided. However, the element is not working to the best of its abilities. For example, the element might not be operating at optimal performance or it might be reporting recoverable errors. 'OK' (5) - The element is fully functional and is operating within normal operational parameters and without error. 'Unknown' (0) - The implementation cannot report on HealthState at this time. DMTF has reserved the unused portion of the continuum for additional HealthStates in the future.")
