msvmnjScheduledStartTime = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 5, 12, 1, 32), DateAndTime()).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmnjScheduledStartTime.setStatus('current')
if mibBuilder.loadTexts: msvmnjScheduledStartTime.setDescription('The time that the current Job is scheduled to start. This time can be represented by the actual date and time, or an interval relative to the time that this property is requested. A value of all zeroes indicates that the Job is already executing. The property is deprecated in lieu of the more expressive scheduling properties, RunMonth, RunDay, RunDayOfWeek, and RunStartInterval.')
