if mibBuilder.loadTexts: msvmnjStatusDescriptions.setStatus('current')
if mibBuilder.loadTexts: msvmnjStatusDescriptions.setDescription("Strings describing the various OperationalStatus array values. For example, if 'Stopping' is the value assigned to OperationalStatus, then this property may contain an explanation as to why an object is being stopped. Note that entries in this array are correlated with those at the same array index in OperationalStatus.")
