msvmveOperationalEndpointMode = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 5, 23, 1, 16), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3, 4, 5, 6))).clone(namedValues=NamedValues(("dmtfReserved", 0), ("other", 1), ("access", 2), ("dynamicAuto", 3), ("dynamicDesirable", 4), ("trunk", 5), ("dot1QTunnel", 6)))).setMaxAccess("readonly")
