msvmdskdvHealthState = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 4, 1, 18), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 5, 10, 15, 20, 25, 30))).clone(namedValues=NamedValues(("unknown", 0), ("ok", 5), ("degradedWarning", 10), ("minorfailure", 15), ("majorfailure", 20), ("criticalfailure", 25), ("nonrecoverableerror", 30)))).setMaxAccess("readonly")
