if mibBuilder.loadTexts: msvmldExtentStatus.setStatus('current')
if mibBuilder.loadTexts: msvmldExtentStatus.setDescription("StorageExtents have additional status information beyond that captured in the OperationalStatus and other properties, inherited from ManagedSystemElement. This additional information (for example, 'Protection Disabled', value=9) is captured in the ExtentStatus property. 'In-Band Access Granted' says that access to data on an extent is granted to some consumer and is only valid when 'Exported' is also set. It is set as a side effect of PrivilegeManagementService.ChangeAccess or equivalent interfaces. 'Imported' indicates that the extent is used in the current system, but known to be managed by some other system. For example, a server imports volumes from a disk array. 'Exported' indicates the extent is meant to be used by some comsumer. A disk array's logical units are exported. Intermediate composite extents may be neither imported nor exported.")
msvmldHealthState = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 8, 1, 21), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 5, 10, 15, 20, 25, 30))).clone(namedValues=NamedValues(("unknown", 0), ("ok", 5), ("degradedWarning", 10), ("minorfailure", 15), ("majorfailure", 20), ("criticalfailure", 25), ("nonrecoverableerror", 30)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmldHealthState.setStatus('current')
if mibBuilder.loadTexts: msvmldHealthState.setDescription("Indicates the current health of the element. This attribute expresses the health of this element but not necessarily that of its subcomponents. The possible values are 0 to 30, where 5 means the element is entirely healthy and 30 means the element is completely non-functional. The following continuum is defined: 'Non-recoverable Error' (30) - The element has completely failed, and recovery is not possible. All functionality provided by this element has been lost. 'Critical Failure' (25) - The element is non-functional and recovery might not be possible. 'Major Failure' (20) - The element is failing. It is possible that some or all of the functionality of this component is degraded or not working. 'Minor Failure' (15) - All functionality is available but some might be degraded. 'Degraded/Warning' (10) - The element is in working order and all functionality is provided. However, the element is not working to the best of its abilities. For example, the element might not be operating at optimal performance or it might be reporting recoverable errors. 'OK' (5) - The element is fully functional and is operating within normal operational parameters and without error. 'Unknown' (0) - The implementation cannot report on HealthState at this time. DMTF has reserved the unused portion of the continuum for additional HealthStates in the future.")
