msvmsjHealthState = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 12, 1, 11), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 5, 10, 15, 20, 25, 30))).clone(namedValues=NamedValues(("unknown", 0), ("ok", 5), ("degradedWarning", 10), ("minorfailure", 15), ("majorfailure", 20), ("criticalfailure", 25), ("nonrecoverableerror", 30)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmsjHealthState.setStatus('current')
if mibBuilder.loadTexts: msvmsjHealthState.setDescription("Indicates the current health of the element. This attribute expresses the health of this element but not necessarily that of its subcomponents. The possible values are 0 to 30, where 5 means the element is entirely healthy and 30 means the element is completely non-functional. The following continuum is defined: 'Non-recoverable Error' (30) - The element has completely failed, and recovery is not possible. All functionality provided by this element has been lost. 'Critical Failure' (25) - The element is non-functional and recovery might not be possible. 'Major Failure' (20) - The element is failing. It is possible that some or all of the functionality of this component is degraded or not working. 'Minor Failure' (15) - All functionality is available but some might be degraded. 'Degraded/Warning' (10) - The element is in working order and all functionality is provided. However, the element is not working to the best of its abilities. For example, the element might not be operating at optimal performance or it might be reporting recoverable errors. 'OK' (5) - The element is fully functional and is operating within normal operational parameters and without error. 'Unknown' (0) - The implementation cannot report on HealthState at this time. DMTF has reserved the unused portion of the continuum for additional HealthStates in the future.")
msvmsjInstallDate = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 12, 1, 12), DateAndTime()).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmsjInstallDate.setStatus('current')
if mibBuilder.loadTexts: msvmsjInstallDate.setDescription('A datetime value that indicates when the object was installed. Lack of a value does not indicate that the object is not installed.')
msvmsjInstanceID = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 12, 1, 13), WtcsDisplayString()).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmsjInstanceID.setStatus('current')
if mibBuilder.loadTexts: msvmsjInstanceID.setDescription("Within the scope of the instantiating Namespace, InstanceID opaquely and uniquely identifies an instance of this class. In order to ensure uniqueness within the NameSpace, the value of InstanceID SHOULD be constructed using the following 'preferred' algorithm: <OrgID>:<LocalID> Where <OrgID> and <LocalID> are separated by a colon ':', and where <OrgID> must include a copyrighted, trademarked or otherwise unique name that is owned by the business entity that is creating or defining the InstanceID, or that is a registered ID that is assigned to the business entity by a recognized global authority. (This requirement is similar to the <Schema Name>_<Class Name> structure of Schema class names.) In addition, to ensure uniqueness <OrgID> must not contain a colon (':'). When using this algorithm, the first colon to appear in InstanceID must appear between <OrgID> and <LocalID>. <LocalID> is chosen by the business entity and should not be re-used to identify different underlying (real-world) elements. If the above 'preferred' algorithm is not used, the defining entity must assure that the resulting InstanceID is not re-used across any InstanceIDs produced by this or other providers for the NameSpace of this instance. For DMTF defined instances, the 'preferred' algorithm must be used with the <OrgID> set to 'CIM'.")
msvmsjJobCompletionStatusCode = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 10, 12, 1, 14), Gauge32()).setMaxAccess("readonly")
