if mibBuilder.loadTexts: msvmcjRunStartInterval.setDescription("The time interval after midnight when the Job should be processed. For example, 00000000020000.000000:000 indicates that the Job should be run on or after two o'clock, local time or UTC time (distinguished using the LocalOrUtcTime property.")
