if mibBuilder.loadTexts: msvmcjScheduledStartTime.setDescription('The time that the current Job is scheduled to start. This time can be represented by the actual date and time, or an interval relative to the time that this property is requested. A value of all zeroes indicates that the Job is already executing. The property is deprecated in lieu of the more expressive scheduling properties, RunMonth, RunDay, RunDayOfWeek, and RunStartInterval.')
msvmcjStartTime = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 13, 2, 1, 31), DateAndTime()).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmcjStartTime.setStatus('current')
if mibBuilder.loadTexts: msvmcjStartTime.setDescription("The time that the Job was actually started. This time can be represented by an actual date and time, or by an interval relative to the time that this property is requested. Note that this property is also present in the JobProcessingStatistics class. This class is necessary to capture the processing information for recurring Jobs, because only the 'last' run time can be stored in this single-valued property.")
msvmcjStatus = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 13, 2, 1, 32), WtcsDisplayString().subtype(subtypeSpec=ValueSizeConstraint(0, 10))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmcjStatus.setStatus('current')
if mibBuilder.loadTexts: msvmcjStatus.setDescription('A string indicating the current status of the object. Various operational and non-operational statuses are defined. This property is deprecated in lieu of OperationalStatus, which includes the same semantics in its enumeration. This change is made for 3 reasons: 1) Status is more correctly defined as an array. This definition overcomes the limitation of describing status using a single value, when it is really a multi-valued property (for example, an element might be OK AND Stopped. 2) A MaxLen of 10 is too restrictive and leads to unclear enumerated values. 3) The change to a uint16 data type was discussed when CIM V2.0 was defined. However, existing V1.0 implementations used the string property and did not want to modify their code. Therefore, Status was grandfathered into the Schema. Use of the deprecated qualifier allows the maintenance of the existing property, but also permits an improved definition using OperationalStatus.')
