msvmesdIsMaximum = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 13, 3, 1, 4), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("unknown", 0), ("notApplicable", 1), ("isMaximum", 2), ("isNotMaximum", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmesdIsMaximum.setStatus('current')
if mibBuilder.loadTexts: msvmesdIsMaximum.setDescription("This property affects the interpretation of all non-null, non-enumerated, non-binary, numeric, non-key properties of the associated SettingData instance. All other properties of the associated SettingData instance are not affected by this property. Note: It is assumed that the semantics of each property of this set are designed to be compared mathematically. When IsMaximum = 'Is Maxiumum', this property indicates that the affected property values specified in the associated SettingData instance shall define maximum setting values. When IsMaximum = 'Is Not Maxiumum', this property indicates that the affected property values specified in the associated SettingData instance shall not define maximum setting values. When IsMaximum = 'Unknown', this property indicates that the affected property values specified in the associated SettingData instance may correspond to maximum setting values. When IsMaximum = 'Not Applicable', this property indicates that the affected property values specified in the associated SettingData instance shall not be interpreted with respect to whether each defines a maximum.")
msvmesdIsMinimum = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 13, 3, 1, 5), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("unknown", 0), ("notApplicable", 1), ("isMinimum", 2), ("isNotMinimum", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmesdIsMinimum.setStatus('current')
if mibBuilder.loadTexts: msvmesdIsMinimum.setDescription("This property affects the interpretation of all non-null, non-enumerated, non-binary, numeric, non-key properties of the associated SettingData instance. All other properties of the associated SettingData instance are not affected by this property. Note: It is assumed that the semantics of each property of this set are designed to be compared mathematically. When IsMinimum = 'Is Miniumum', this property indicates that the affected property values specified in the associated SettingData instance shall define minimum setting values. When IsMinimum = 'Is Not Miniumum', this property indicates that the affected property values specified in the associated SettingData instance shall not define minimum setting values. When IsMinimum = 'Unknown', this property indicates that the affected property values specified in the associated SettingData instance may correspond to minimum setting values. When IsMinimum = 'Not Applicable', this property indicates that the affected property values specified in the associated SettingData instance shall not be interpreted with respect to whether each defines a minimum.")
msvmesdIsNext = MibTableColumn((1, 3, 6, 1, 4, 1, 9600, 1, 25, 13, 3, 1, 6), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3))).clone(namedValues=NamedValues(("unknown", 0), ("isNext", 1), ("isNotNext", 2), ("isNextForSingleUse", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: msvmesdIsNext.setStatus('current')
if mibBuilder.loadTexts: msvmesdIsNext.setDescription("An enumerated integer indicating whether or not the referenced setting is the next setting to be applied. For example, the application could take place on a re-initialization, reset, reconfiguration request. This could be a permanent setting, or a setting used only one time, as indicated by the flag. If it is a permanent setting then the setting is applied every time the managed element reinitializes, until this flag is manually reset. However, if it is single use, then the flag is automatically cleared after the settings are applied. Also note that if this flag is specified (i.e. set to value other than 'Unknown'), then this takes precedence over any SettingData that may have been specified as Default. For example: If the managed element is a computer system, and the value of this flag is 'Is Next', then the setting will be effective next time the system resets. And, unless this flag is changed, it will persist for subsequent system resets. However, if this flag is set to 'Is Next For Single Use', then this setting will only be used once and the flag would be reset after that to 'Is Not Next'. So, in the above example, if the system reboots in a quick succession, the setting will not be used at the second reboot.")
